import React, { Component } from 'react';

export default class CreateTray extends Component {
  constructor(props) {
    super(props);

      this.state = {
        plant_species: '',
        grams_of_seed: '',
        germ_date: '',
        light_date: '',
        harvested: false,
        yield: ''
      }
  }

  onChangePlantSpecies(e) {
    this.setState({
      plant_species: e.target.value
    });
  }
  onChangeGramsOfSeed(e) {
    this.setState({
      grams_of_seed: e.target.value
    });
  }
  onChangeGermDate(e) {
    this.setState({
      germ_date: e.target.value
      });
  }
  onChangeLightDate(e) {
              this.setState({
                  light_date: e.target.value
              });
          }

          onChangeHarvested(e) {
              this.setState({
                  todo_responsible: e.target.value
              });
          }

          onChangeTodoPriority(e) {
              this.setState({
                  todo_priority: e.target.value
              });
          }

    render() {
        return (
            <div>
                <p>What's this tray going to be??</p>
            </div>
        )
    }
}
